function Home() {
  return (
    <div className ="home">

  <div className="home__container1">

    <div className="home__container1_left">
     
     <div className="home__container1_left_option">
    <div className="facebook">
    <a href="https://www.facebook.com/"><FacebookIcon className="left_icon"/></a>
    </div>
     </div>
     <div className="home__container1_left_option">
     <div className="twitter">
     <a href="https://www.twitter.com"><TwitterIcon className="facebook__icon"/></a>
      </div>
     </div>
     <div className="home__container1_left_option">
     <div className="linkedin">
     <a href="https://www.linkedin.com"><LinkedInIcon className="facebook__icon" /></a>
      </div>
     </div>

    </div>

    <div className="home__container1_right">

    </div>
    
  </div>

    </div>


  );
}

export default Home;
